import styled from 'styled-components';

import Logo from './Logo';
import SearchBar from './SearchBar';
import User from './User'


const NavBar = () => {
    const Nav = styled.nav`
    display:grid;
    grid-template-columns: 100px 1fr 100px;
    place-items:center;
    width:80%;
    margin: 0 auto;`
    return <Nav>
        <Logo />
        <SearchBar />
        <User />
    </Nav>

}

export default NavBar
